  doc.text(5, 67, sushiPopulatedFields[7]);
  doc.text(5, 74, sushiPopulatedFields[8]);
  doc.text(5, 81, sushiPopulatedFields[9]);
  doc.text(5, 88, sushiPopulatedFields[10]);
  doc.text(5, 95, sushiPopulatedFields[11]);
  // Round 2 Drinks
